方法2：辅助栈[不浪费空间]

升级版本辅助栈，当push 进去的时候，
当help的栈顶元素比新来的元素小的时候，这个时候保持help不变
当help的栈顶元素大于等于新来的元素时，help同步要推一份新的元素进来
当help元素为空的时候，也需要往里推


pop的时候，pop的元素是否和help 的元素有重叠，有就将help的元素pop出去，没有就维持不动，data栈正常pop

class MinStack {
    Stack data;
    Stack help;

    /**
     * initialize your data structure here.
     */
    public MinStack() {
        data = new Stack<>();
        help = new Stack<>();
    }

    public void push(int x) {
        if (help.isEmpty() || help.peek() >= x) {
            help.push(x);
        }
        data.push(x);

    }

    public void pop() {
        if (data.isEmpty()) throw new RuntimeException("The stack is empty");
        int pop = data.pop();
        if (pop == help.peek()) {
            help.pop();
        }
    }

    public int top() {
        if (data.isEmpty()) throw new RuntimeException("The stack is empty");
        return data.peek();
    }

    public int getMin() {
        if (help.isEmpty()) throw new RuntimeException("The stack is empty");
        return help.peek();
    }
}

