public boolean canJump4th(int[] nums) {
    int n = nums.length;
    //最后一个位置
    int lastPos = n - 1;
    //倒数第二个位置开始
    for (int i = n - 2; i >= 0; i--) {
        //如果当前的位置能跳跃到上一个位置lastPos，更新上一个位置lastPos
        if (i + nums[i] >= lastPos) {
            lastPos = i;
        }
    }
    //是否到开头了
    return lastPos == 0;
}

